import React, { useState } from "react";

import "./App.css";

function App() {
  const bgChange = () => {
    // console.log("clicked");
    const purple = "#8e44ad";
    const [bg, setBg] = useState(purple);
  };

  return (
    <>
      <div style={{ backgroundColor: "purple" }}>
        <button onClick={bgChange()}> Click Me </button>
      </div>
    </>
  );
}

export default App;
